/**
 * @brief Check if the array is ordered.
 * 
 * @param v             The pointer to the array
 * @param len           The lenght of the array
 * @return short int    1 if it's ordered, 0 otherwise.
 */
short int array_is_ordered(ELEMENT_TYPE *v, size_t len)
{
    for (size_t i = 0; i < len - 1; i++)
    {
        if (v[i] > v[i+1])
        {
            return 0;
        }
    }
    return 1;
}

/**
 * @brief Check if two array are equals.
 * 
 * @param v1        The first array.
 * @param v2        The second array.
 * @param len       The array's lenght.
 * @return short int    1 if the array are equals, otherwise 0.
 */
short int array_is_equal(ELEMENT_TYPE *v1, ELEMENT_TYPE *v2, size_t len)
{
    for (size_t i = 0; i < len; i++)
    {
        if (v1[i] != v2[i])
        {
            return 0;
        }
    }
    return 1;
}

/**
 * @brief Test case 1: Random inizialized with init function and verify the order.
 * 
 * @return unsigned short   1 if the test pass, 0 otherwise
 */
unsigned short test1()
{
    ELEMENT_TYPE *input;
    int len=1000, min=-43, max=234;

    init_rand_vector(&input, len, min, max);
    counting_sort(input, len);

    int ord = array_is_ordered(input, len);

    deinit_rand_vector(input);

    return ord;
}

